import React, { Component } from "react";
import ReactEcharts from "echarts-for-react";

function Line() {
  return (
    <ReactEcharts
      option={{
        xAxis: {
          type: "category",
          data: [
            "January",
            "February",
            "March",
            "April",
            "May",
            "June",
            "July",
            "August",
            "September",
            "October",
            "November",
            "December",
          ],
        },
        yAxis: {
          type: "value",
        },
        series: [
          {
            data: [
              820, 932, 901, 934, 1290, 1330, 1320, 1230, 520, 1230, 120, 1230,
            ],
            type: "line",
          },
        ],
      }}
    />
  );
}
export default Line;
